import React from 'react';
import './Ourstats.css';
import CountUp, { useCountUp } from 'react-countup';

function Ourstats() {


  return (
    <div className='stats-container'>
        <div className='stats-items'>
        <div className='stat'> <CountUp end={90} duration={8} suffix={"+ members"}  useEasing  scrollSpyOnce /> </div>
        <div className='stat'> <CountUp end={1000} duration={8} suffix={"+ memories created"}  scrollSpyOnce useEasing /> </div>
        <div className='stat'> <CountUp end={1} duration={2} suffix={" commuinity made"}  useEasing  scrollSpyOnce /> </div>
        </div>
    </div>  
  );
}

export default Ourstats;
